import React, {Component} from 'react';
import './Authen.css'
import {Link} from "react-router-dom";
import {callApi} from "../../utils/apiCaller";
import {NotificationManager} from "react-notifications";

class Login extends Component {

    constructor(props) {
        super(props);
        this.state = {
            email: '',
            password: ''
        }
    }

    handleChange = (event) => {
        const target = event.target;
        let value = target.value;
        if(target.type === 'file') {
            value = target.files;
        } else if(target.type === 'checkbox') {
            value = target.checked;
        }
        const name = target.name;
        this.setState({
            [name]: value
        });
    };

    handleSubmit = (event) => {
        event.preventDefault();
        console.log(this.state);
        let {email, password} = this.state;

        const formData = new FormData();
        formData.append('projectName', projectName);
        formData.append('category', category);
        formData.append('investor', investor);
        formData.append('address', address);
        formData.append('area', area);
        formData.append('time', time);
        formData.append('isMain', isMain);
        for(let i = 0; i < files.length; i++) {
            formData.append('file', files[i]);
        }
        const headers = {
            'content-type': 'multipart/form-data'
        };
        this.setState({
            isLoading: true
        });
        callApi("product/uploads", 'POST', formData, headers).then(res => {
            console.log(res);
            NotificationManager.success('Success message', '', 1000, null, true);
            this.setState({
                isLoading: false,
                isDisplayAlert: true,
                messageAlert: 'Tạo sảm phẩm thành công'
            });
        });
    };

    render() {
        return (
            <div className="col-md-12">
                <div className="container col-md-4 form">
                    <form onSubmit={this.handleSubmit}>
                        <div className="form-group">
                            <label For="exampleInputEmail1">Email address</label>
                            <input
                                type="email"
                                className="form-control"
                                name="email"
                                placeholder="Enter email"
                                value={this.state.email}
                                onChange={this.handleChange}
                            />
                            <small id="emailHelp" className="form-text text-muted">We'll never share your email with anyone
                                else.
                            </small>
                        </div>
                        <div className="form-group">
                            <label For="exampleInputPassword1">Password</label>
                            <input
                                type="password"
                                className="form-control"
                                name="password"
                                placeholder="Password"
                                value={this.state.password}
                                onChange={this.handleChange}
                            />
                        </div>
                        <div className="form-check">
                            <input type="checkbox" className="form-check-input" id="exampleCheck1"/>
                            <label className="form-check-label" For="exampleCheck1">Remember me</label>
                        </div>
                        <Link type="submit" className="btn btn-primary login-btn" to="/main">Login</Link>
                    </form>
                    <p className="register-label">
                        Don't have a account? <Link to="/register" type="button">REGISTER HERE</Link>
                    </p>
                </div>
            </div>
        );
    }
}

export default Login;
